    return(
        <>
        <div>
            <Row><Navigation/></Row>
            <Row>
                <Col></Col>
                {/* Login Page */}
                <Col> 
                 <h1>Login Page</h1>
                 <input type="email" placeholder="Username" className="email" />
                 <input type="password" placeholder="Password" className="email" />
                 <button>Subbmit</button>
                </Col>
                <Col></Col>
            </Row>

        
        </div>
        </>
    )
};

export default Login
